import React from "react";

const Card = ({ book }) => {
  console.log(book);

  return (
    <>
      {book.map((item) => {
        let thumbnail =
          item.volumeInfo.imageLinks &&
          item.volumeInfo.imageLinks.smallThumbnail;

        return (
          <>
            <div>
              <h3>React.js</h3>
              <img className="h-40" src={thumbnail} />
            </div>
          </>
        );
      })}
    </>
  );
};

export default Card;
